function initDB(tx) {
    db = window.openDatabase("ProductDB10", "1.0", "Product DB", 2 * 1024 * 1024);
	
	checkDBExists();
}

function checkDBExists() {
    db.transaction(function(tx) {
		tx.executeSql('SELECT * FROM units', [], 
			function(tx, results) { }, 
			function(err) { 
    	        db.transaction(putDBData, queryDBError, function (tx, results) { }); 
			}); }, queryDBError);
}

